import React from "react";
import { useHistory } from "react-router-dom";
import logo_everis from "../Static/Img/images/logo-everis.png";
import PersonIcon from "@material-ui/icons/Person";
import Fab from '@material-ui/core/Fab';

import ExitToAppIcon from "@material-ui/icons/ExitToApp";
const axios = require("axios");

export const NavbarComponent = () => {
  let history = useHistory();
  return (
    <>
      <nav
        class="navbar is-transparent"
        role="navigation"
        aria-label="main navigation"
      >
        <div class="navbar-brand">
          <div class="navbar-item">
            <figure class="image is-48x48">
              <img alt="everis" src={logo_everis} />
            </figure>
            <h3>Business Development</h3>
          </div>
        </div>

        <div id="navbarBasicExample" class="navbar-menu">
          <div class="navbar-start"></div>
        </div>

        <div class="navbar-end">
        <div class="navbar-item">

          <PersonIcon/> {sessionStorage.getItem("username").toUpperCase()}
          </div>
          <div class="navbar-item">

              <button
                className="button is-link"
                onClick={() =>
                  axios
                    .get(
                      `${
                        process.env.REACT_APP_API_ROOT_URL
                      }/oauth/revoke-token/${sessionStorage.getItem(
                        "username"
                      )}`,
                      {
                        headers: {
                          "Content-Type": "application/json",
                          Authorization:
                            "Bearer " + sessionStorage.getItem("user_token"),
                        },
                      }
                    )
                    .then(function (response) {
                      // handle success
                    })
                    .catch(function (error) {
                      // handle error
                    })
                    .finally(function () {
                      // always executed
                      sessionStorage.removeItem("user_token");
                      history.push("/");
                    })
                }
              >
                <ExitToAppIcon />
                Logout
              </button>

          </div>
        </div>
      </nav>
    </>
  );
};

export default NavbarComponent;
